import React from 'react';
import CardList from './CardList';
import { pokemons } from './Pokemon';
import SearchBox from './SearchBox';

const App = () => {
	return (
		<div className = 'tc'>
			<h1> Pokemon Index </h1>
			<SearchBox/>
			<CardList pokemons={pokemons} />
		</div>
	);
};

export default App;
